        { id: 2, name: "newYork" , img: "https://cdn.cnn.com/cnnnext/dam/assets/210409114908-nyc-april-2021-tease-super-tease.jpg"},
      ])

    return (
        <div>
          {newarray.map((item)=>{
  return (
  <div > 
  {item.id }
  {item.name}
  <img src={item.img} alt="city"/>

          </div> 
          )
        })} 


        </div>
    )
}
